import { userForm } from "./Fetch";
import css6 from "./Task6.module.css";

function Task6() {
  const [loadingData, setLoadingData] = useState([]);

  const data = userForm();
  const handleData = async (e) => {
    e.preventDefault();

    setLoadingData(data);
  };

  return (
    <div className={css6.card}>
      <h3>Task 6</h3>
      <ul>
        {data.map((item) => (
          <li key={item.id}> Name:{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default Task6;

